import React, { useState } from "react";

function LittleEndian(){
    const [inputValue, setInputValue] = useState("");

    setInputValue = (event) => {
        event.target.value;
    }

    return (
        <div className="littleEndianArea">
            <textarea id="stingCalculator" name="stingCalculator" rows="4" cols="50" value={inputValue} onChange={setInputValue}/>

            <span>{inputValue}</span>
        </div>
    );
}

export default LittleEndian;
